theme.css:
.x-mark {
  stroke: rgba(0, 255, 0, 0.85);
}

.chain td, .circle-cell {
  color: rgb(15, 161, 10);
  background-color: rgb(0, 0, 0);
}

:root {
  --chain-border-color: rgb(21, 202, 18);
  --background-icons: rgba(50, 255, 50, 0.2);
  --button-background: rgb(0, 0, 0);
  --btn-view-effect: rgba(55, 255, 0, 0.5);
  --btn-color-settings-effect: rgba(55, 255, 0, 0.5);
  --btn-add-chain-effect: rgba(55, 255, 0, 0.5);
  --btn-load-file-effect: rgba(55, 255, 0, 0.5);
  --btn-backup-download-effect: rgba(55, 255, 0, 0.5);
  --btn-reset-effect: rgba(55, 255, 0, 0.5);
  --btn-delete-effect: rgba(55, 255, 0, 0.5);
  --app-card-bd: rgba(52, 215, 20, 0.644);
  --app-card-bg: rgba(0, 0, 0, 0.575);
  --chain-month-label-bg: rgb(0, 0, 0);
  --chain-month-label: rgb(11, 214, 37);
  --btn-toggle-menu-effect: rgba(55,255,0,0.5);
  --outer-layer-bg: rgb(0, 0, 0);
  --outer-scroll-track: rgb(0, 0, 0);
  --outer-scroll-thumb: rgb(20, 185, 28);
  --app-card-thumb: rgba(0, 255, 0, 0.6);
}

.main-frame {
  background-color: rgba(0, 0, 0, 0.733);
  border-color: rgba(19, 181, 8, 0.62);
}

.main-title {
  color: rgb(64, 231, 4);
}

hr {
  border-color: rgb(55, 255, 0);
}

.selections label {
  color: rgb(10, 103, 4);
  border-color: rgb(52, 255, 26);
}

#btn-toggle-menu {
  color: rgb(81, 255, 0);
  border-color: rgb(85, 242, 28);
}

#btn-view {
  color: rgb(81, 255, 0);
  border-color: rgb(85, 242, 28);
}

#btn-color-settings {
  border-color: rgb(85, 242, 28);
  color: rgb(81, 255, 0);
}

#btn-add-chain {
  color: rgb(81, 255, 0);
  border-color: rgb(85, 242, 28);
}

#btn-load-file {
  color: rgb(81, 255, 0);
  border-color: rgb(85, 242, 28);
}

#btn-backup-download {
  color: rgb(81, 255, 0);
  border-color: rgb(85, 242, 28);
}

#btn-reset {
  color: rgb(81, 255, 0);
  border-color: rgb(85, 242, 28);
}

#btn-delete {
  color: rgb(81, 255, 0);
  border-color: rgb(85, 242, 28);
}

.chain-title {
  color: rgb(35, 201, 13);
}

.chain-info {
  color: rgb(38, 132, 26);
}

.chain-tab {
  color: rgb(0, 255, 8);
}

.chain tr:first-child > th:not(:first-child) {
  background-color: rgb(0, 0, 0);
  color: rgb(37, 214, 11);
}

.chain tr:first-child > th:first-child {
  color: rgb(17, 120, 17);
}

.chain td.empty-cell {
  background-color: rgb(0, 0, 0);
}

.chain td.month-break-left {
  border-left-color: rgb(0, 255, 0);
}

.chain td.year-break-left {
  border-left-color: rgb(0, 255, 0);
}

#show-count {
  color: rgb(30, 255, 0);
}

.parenthesis {
  color: rgb(47, 162, 32);
}

.ring-number-box {
  background-color: rgba(0, 0, 0, 0.34);
  border-color: rgba(61, 214, 31, 0.62);
}

.helper-info {
  color: rgb(25, 210, 31);
}

.size-box > * {
  border-color: rgb(61, 255, 68);
}

.radio-type label:has(input:checked) {
  color: rgb(0, 255, 0);
  background-color: rgba(10, 75, 0, 0.5);
}

#weekdays label:has(input:checked) {
  color: rgb(15, 255, 15);
  background-color: rgba(3, 10, 0, 0.5);
}

input {
  color: rgb(3, 204, 0);
  background-color: rgb(3, 10, 0);
  border-color: rgb(18, 105, 7);
}

.error-info {
  color: rgb(0, 255, 0);
  background-color: rgb(0, 0, 0);
  border-color: rgb(94, 255, 36);
}

.form-titles {
  color: rgb(48, 225, 20);
}

#btn-toggle-menu:active {
  background-color: var(--btn-toggle-menu-effect);
}

#btn-view .knob {
  background-color: rgb(47, 97, 41);
}

.input-error {
  box-shadow: rgba(0, 255, 13, 0.8) 0px 0px 0px 2px;
}

input:focus, input:focus-visible {
  outline: none;
  box-shadow: rgba(0, 255, 13, 0.55) 0px 0px 0px 3px;
  color: rgb(3, 204, 0);
  background-color: rgb(3, 10, 0);
  border-color: rgb(0, 218, 91);
}

::placeholder {
  color: rgb(16, 214, 16);
  opacity: 1;
}

::-webkit-calendar-picker-indicator {
  filter: invert(48%) sepia(79%) saturate(451%) hue-rotate(90deg) brightness(95%) contrast(95%);
}

::-webkit-inner-spin-button {
  filter: invert(1);
}

:not(i):not(#theme-panel):not(#theme-panel *) {
  font-family: "Courier New", Courier, monospace;
}

.size-box .form-titles,
.month-label {
  letter-spacing: -0.15ch;
}

.empty-cell {
  border: 0 !important;
}
